//import React from 'react'
import './topbar.scss';

export default function Topbar() {
    return (
        <div className="topbar">
            <div className="wrapper">
                <div className="left">
                    <a href="#intro" className="logo">Abhyuday Singh</a>
                </div>
                <div className="right">
                    <a href="#intro" className="topright">About</a>
                    <a href="#home" className="topright">Projects</a>
                    <a href="#contact" className="topright">Contact</a>

                </div>
            </div>
        </div>
    )
}
